        /**
         * Получили пакет Ping, отвечаем пакетом Pong
        * */
        public static void OnPacketReceive_Ping(ClientConnection net, PacketReader reader)
        {
            //Ping
            var number1 = reader.ReadLEInt64(); //tm
            var number2 = reader.ReadLEInt64(); //when
            var number3 = reader.ReadLEInt32(); //local
            net.SendAsync(new NP_Pong(number1, number2, number3));
        }

